import './RandomPalette.scss';

const RandomPalette = ({ palette }) => {
	if (!palette.length) {
		return <></>;
	} else {
		const createdColor = palette.map((color, i) => {
			return <div key={i} style={{ background: color.hex.value }}></div>;
		});
